import Background from '../assets/Home.jpg'

var sectionStyle = {
    width: "100%",
    height: "100%",
    BackgroundImage: "url(" + {Background} + ")"
};

const Home = () => {
    return(
        <div className="bg-fixed" style={sectionStyle}> Home </div>
        )
}

export default Home;
